import ExpenseItem from "./components/ExpenseItem";
function App() {
  const expenses = [
    { id: "e1", title: "toilet paper", date: new Date(2023, 2, 28) },
    { id: "e2", title: "new pc", amount: 1000.12, date: new Date(2023, 1, 29) },
    {
      id: "e3",
      title: "Car Insurence",
      amount: 289.21,
      date: new Date(2023, 3, 7),
    },
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem>
        title = {expenses[0].title} amount={expenses[0].amount} date=
        {expenses[0].date}
      </ExpenseItem>
      <ExpenseItem></ExpenseItem>
      <ExpenseItem></ExpenseItem>
      <ExpenseItem></ExpenseItem>
    </div>
  );
}

export default App;
